import './App.css';
import { HomePage } from './app/containers/HomePage';
import React from "react";
import { BrowserRouter as Router , Route, Switch} from 'react-router-dom';



function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/">
            <HomePage />
          </Route>
        </Switch>
      </div>
    </Router>
  );

}

export default App;
